import Content from '../../lib/content';

const title = 'Work';

export default function Works({ jobs }) {
	const [ filters, setFilters ] = useState([]);

	return (
		<Layout page="work">
			<h3 className="text-center text-xl py-4">{title}</h3>
			<Data filters={filters} data={jobs} />
		</Layout>
	);
}

